import React, { useState, createContext } from "react";
export const ViewContext = createContext(null);

export const ViewContextProvider = ({ children }) => {
  const [view, setView] = useState(null);

  return (
    <ViewContext.Provider
      value={{
        view: view,
        setView: setView,
      }}
    >
      {children}
    </ViewContext.Provider>
  );
};
